                            transformOrigin: "center"
                        });

                        gsap.set(["#matched", "#duplicates", "#unmatched"], { 
                            autoAlpha: 0,
                            scale: 1.2,
                            transformOrigin: "center"
                        });





                        
                    //  Loader Timeline
                        const loader_tl = gsap.timeline({ 
                            repeat: -1,
                            repeatDelay: 1,
                            paused: true
                        });

                        loader_tl.to("#logo_loader .loader-line", {
                            y: -5,
                            duration: 0.3,
                            ease: "power4.inOut",
                            stagger: {
                                each: 0.1
                            }
                        });

                        loader_tl.to("#logo_loader .loader-line", {
                            y: 0,
                            duration: 0.3,
                            ease: "power4.inOut",
                            stagger: {
                                each: 0.1
                            }
                        });

                        loader_tl.to(logo_loader, {
                            scale: 1.1,
                            duration: 0.5,
                            ease: "power3.out",
                        }, 0);

                        loader_tl.to(logo_loader, {
                            scale: 1,
                            duration: 0.5,
                            ease: "power3.out",
                        });

                    //  Main Timeline
                        const danish_tl = gsap.timeline({ 
                            repeat: -1,
                            repeatDelay: 4,
                            paused: true
                        });

                        danish_tl.to(intro_left, {
                            x: 0,
                            duration: 0.7,
                            ease: "power4.out",
                        });

                        danish_tl.to(btn, {
                            x: 0,
                            duration: 0.7,
                            ease: "power4.out",
                        }, "<=0%");

                        danish_tl.to(mouse_cursor, {
                            x: -120,
                            y: -280,
                            duration: 1,
                            ease: "power4.out",
                        });

                        danish_tl.to(btn, {
                            scale: 1.1,
                            duration: 0.7,
                            ease: "power4.out",
                        }, "<=50%");

                        danish_tl.to(btn.querySelector(':scope > path'), {
                            fill: "#279662",
                            duration: 0.7,
                            ease: "power4.out",
                        }, "<=0%");

                        danish_tl.to(btn.querySelectorAll(':scope > g *'), {
                            fill: "#FFFFFF",
                            duration: 0.7,
                            ease: "power4.out",
                        }, "<=0%");

                        danish_tl.to(btn, {
                            scale: 0.95,
                            duration: 0.2,
                            ease: "power4.out",
                        });

                        danish_tl.to(btn, {
                            scale: 1,
                            duration: 0.2,
                            ease: "power4.out",
                        });

                        danish_tl.to(intro_left, {
                            x: -370,
                            duration: 0.5,
                            ease: "power4.out",
                        });

                        danish_tl.to(btn, {
                            x: 330,
                            duration: 0.5,
                            ease: "power4.out",
                        }, "<=0%");

                        danish_tl.to(mouse_cursor, {
                            x: 330,
                            duration: 0.5,
                            ease: "power4.out",
                        }, "<=0%");

                        danish_tl.to(rooming_list, { 
                            x: 0,
                            duration: 0.8,
                            ease: "power4.out",
                        }, "<=20%");

                        danish_tl.to(registration_list, { 
                            x: 0,
                            duration: 0.8,
                            ease: "power4.out",
                        }, "<=0%");

                        danish_tl.to(logo_loader, {
                            y: 0,
                            autoAlpha: 1,
                            duration: 0.8,
                            ease: "power4.out",
                        }, "<=0%");

                        danish_tl.to(".con-list-item", {
                            fill: "#69e469",
                            duration: 0.1,
                            ease: "power4.out",
                            stagger: {
                                each: 0.1,
                                from: "random"
                            },
                            onStart: () => {
                                loader_tl.play();
                            },
                            onComplete: () => {
                                loader_tl.pause();
                            }
                        });

                        danish_tl.to(rooming_list, { 
                            x: -350,
                            duration: 0.8,
                            ease: "power4.out",
                        });

                        danish_tl.to(registration_list, { 
                            x: 350,
                            duration: 0.8,
                            ease: "power4.out",
                        }, "<=0%");

                        danish_tl.to(logo_loader, {
                            y: 230,
                            duration: 0.8,
                            ease: "power4.out",
                        }, "<=0%");

                        danish_tl.to(["#matched", "#duplicates", "#unmatched"], { 
                            autoAlpha: 1,
                            scale: 1,
                            duration: 0.8,
                            ease: "power4.out",
                            stagger: {
                                each: 0.1
                            }
                        });

                        danish_tl.to(result_items, {
                            x: 0,
                            autoAlpha: 1,
                            duration: 1,
                            ease: "power4.out",
                            stagger: {
                                each: 0.1
                            }
                        }, "<=20%");

                        
                        
                       

                    //  ScrollTrigger
                        ScrollTrigger.create({
                            trigger: svg_el,
                            start: 'top 50%',
                            end: 'bottom top',
                            // markers: true,
                            onEnter: (self) => {
                                danish_tl.play();
                            }
                        });

              
                

            })();
        </script>
    <!-- End Animation JavaScript -->

</body>


</html>
